const UserTable = (props) => {
  console.log(props.users.name);
  return (
    <table className="table">
      <thead>
        <tr>
          <th>Nombre</th>
          <th>Nombre de usuario</th>
          <th>Accion</th>
        </tr>
      </thead>
      <tbody>
        {
        props.users.length > 0 ? 
          props.users.map((user) => 
            <tr key={user.id}>
              <td>{user.name}</td>
              <td>{user.userName}</td>
              <td>
                <button className="button muted-button" onClick={()=>props.seteEditing(true)}>Editar</button>
                <button className="button muted-button">Elimnar</button>
              </td>
            </tr>
          ) : (
          <td colSpan={3}>No users</td>
        )
        }
      </tbody>
    </table>
  );
};

export default UserTable;
